import './signup.css'

const Signup = () => {
  return (
    <div>
        <h1>Create a New Account</h1>
        <InputElement label='Name' placeholder='Enter your name'  />
    </div>
  )
}

export default Signup

const InputElement = ({label, placeholder, id})=> {
    return (
      <div className='input-div'>
      <label className='label' htmlFor='name' >Enter you name</label>
      <input id='name' type='text' className='form-control input-feild' placeholder='Enter you' />
  </div>
    )
}
